import React from 'react';
import { Link } from 'react-router-dom';
import styled from 'styled-components';

const Nav = styled.nav`
  background-color: #1a1a1a;
  padding: 1rem 2rem;
`;

const NavContainer = styled.div`
  max-width: 1200px;
  margin: 0 auto;
  display: flex;
  justify-content: space-between;
  align-items: center;
`;

const Logo = styled(Link)`
  color: #fff;
  font-size: 1.5rem;
  text-decoration: none;
  font-weight: bold;
`;

const NavLinks = styled.div`
  display: flex;
  gap: 2rem;
`;

const NavLink = styled(Link)`
  color: #fff;
  text-decoration: none;
  &:hover {
    color: #ffd700;
  }
`;

function Navbar() {
  return (
    <Nav>
      <NavContainer>
        <Logo to="/">Gürdal Oto Kaporta</Logo>
        <NavLinks>
          <NavLink to="/">Ana Sayfa</NavLink>
          <NavLink to="/hizmetlerimiz">Hizmetlerimiz</NavLink>
          <NavLink to="/satilik-araclar">Satılık Araçlar</NavLink>
          <NavLink to="/galeri">Galeri</NavLink>
          <NavLink to="/sigorta-kasko">Sigorta & Kasko</NavLink>
          <NavLink to="/hakkimizda">Hakkımızda</NavLink>
          <NavLink to="/iletisim">İletişim</NavLink>
        </NavLinks>
      </NavContainer>
    </Nav>
  );
}

export default Navbar;
